func (o *FSRodentlocation) Preload(name string, retrieved any) error {
	if o == nil {
		return nil
	}

	switch name {
	case "Organization":
		rel, ok := retrieved.(*Organization)
		if !ok {
			return fmt.Errorf("fsRodentlocation cannot load %T as %q", retrieved, name)
		}

		o.R.Organization = rel

		if rel != nil {
			rel.R.FSRodentlocations = FSRodentlocationSlice{o}
		}
		return nil
	default:
		return fmt.Errorf("fsRodentlocation has no relationship %q", name)
	}
}

