// LoadOrganization loads the fsRodentlocation's Organization into the .R struct
func (o *FSRodentlocation) LoadOrganization(ctx context.Context, exec bob.Executor, mods ...bob.Mod[*dialect.SelectQuery]) error {
	if o == nil {
		return nil
	}

	// Reset the relationship
	o.R.Organization = nil

	related, err := o.Organization(mods...).One(ctx, exec)
	if err != nil {
		return err
	}

	related.R.FSRodentlocations = FSRodentlocationSlice{o}

	o.R.Organization = related
	return nil
}

// LoadOrganization loads the fsRodentlocation's Organization into the .R struct
func (os FSRodentlocationSlice) LoadOrganization(ctx context.Context, exec bob.Executor, mods ...bob.Mod[*dialect.SelectQuery]) error {
	if len(os) == 0 {
		return nil
	}

	organizations, err := os.Organization(mods...).All(ctx, exec)
	if err != nil {
		return err
	}

	for _, o := range os {
		if o == nil {
			continue
		}

		for _, rel := range organizations {
			if !o.OrganizationID.IsValue() {
				continue
			}

			if !(o.OrganizationID.IsValue() && o.OrganizationID.MustGet() == rel.ID) {
				continue
			}

			rel.R.FSRodentlocations = append(rel.R.FSRodentlocations, o)

			o.R.Organization = rel
			break
		}
	}

	return nil
}

type fsRodentlocationJoins[Q dialect.Joinable] struct {
	typ          string
	Organization modAs[Q, organizationColumns]
}

func (j fsRodentlocationJoins[Q]) aliasedAs(alias string) fsRodentlocationJoins[Q] {
	return buildFSRodentlocationJoins[Q](buildFSRodentlocationColumns(alias), j.typ)
}

func buildFSRodentlocationJoins[Q dialect.Joinable](cols fsRodentlocationColumns, typ string) fsRodentlocationJoins[Q] {
	return fsRodentlocationJoins[Q]{
		typ: typ,
		Organization: modAs[Q, organizationColumns]{
			c: Organizations.Columns,
			f: func(to organizationColumns) bob.Mod[Q] {
				mods := make(mods.QueryMods[Q], 0, 1)

				{
					mods = append(mods, dialect.Join[Q](typ, Organizations.Name().As(to.Alias())).On(
						to.ID.EQ(cols.OrganizationID),
					))
				}

				return mods
			},
		},
	}
}
